The Reactive Graph binary can now output information about itself. This includes the version number, the rust compiler version, the rust compiler channel, the target triple, and the git commit hash. $ reactive-graph info +---------+--------------------------+---------+------------------------------------------+---------------+---------------+
| version | target_triple | git_tag | git_commit | rustc_channel | rustc_version |
+---------+--------------------------+---------+------------------------------------------+---------------+---------------+
| 0.10.0 | x86_64-unknown-linux-gnu | | 7d8b37cf5549a12a4da5feff5184778d25110e62 | stable | 1.82.0 |
+---------+--------------------------+---------+------------------------------------------+---------------+---------------+ $ reactive-graph info --output-format=json [ { "version": "0.10.0", "target_triple": "x86_64-unknown-linux-gnu", "git_tag": "", "git_commit": "7d8b37cf5549a12a4da5feff5184778d25110e62", "rustc_channel": "stable", "rustc_version": "1.82.0" }
]
